(function loadOverlayConfig() {
	if(!window || !window.$smcO5) {
		window.$smcO5 = {};
	}

	window.$smcO5.cfg = {
		r: 1,
		a: 1,
		b: 1,
		t: 0.03224206,
		o: "",
		c: function overlayLoaderCustomCode() {
			(function( $ ){
    var isDebug = window.$smcDebugger ? 1: 0;
    $smcO5.callback.loaded = function(){
        var cookie = $smcT5.CookieManager.read('smc_dyn_item');
        if(cookie){
            var item = JSON.parse(decodeURIComponent(atob(cookie)));
            var overlay = document.querySelector('div[id^="smc-v5-overlay"]')
            var img = overlay.querySelector('smc-product-img img');
            var name = overlay.querySelector('smc-product-name');
            var price = overlay.querySelector('smc-product-price');
            if(img && name && price){
                img.src = item.img;
                name.innerText = item.title;
                price.innerText = item.price;
            }else{
                if(isDebug) console.warn('[SMC] Couldn\'t find all required fields to replace them.')
            }
        }
    }
    
})( $smcJQ || jQuery );
		}
	}
})();